import Button from 'react-bootstrap/Button';
import ButtonGroup from 'react-bootstrap/ButtonGroup';


function buttons(props){
    const {page} =props
    return ( 
        <div>        
        <ButtonGroup aria-label="Basic example">     
      <Button variant="secondary" onClick={props.prevhandle} >prev</Button>
      <Button variant="secondary" dissabled>{page}</Button>
      <Button variant="secondary" onClick={props.nexthandle}>next</Button>
    </ButtonGroup>
        </div>
         )
}

export default buttons
